Image printed two versions of Spawn 225 - one for if Obama won the election and another one if Romney won.  Each has a different cover and the last story page is different, so because of the different story page, we felt it better to release the two versions separately, rather than packing them into one.

'DE-PROGRAMMED,' Part One MILESTONE 225th issue! AND...FOR THE FIRST TIME...the results of a Presidential Election will directly affect the events to come. On November 6th, the citizens of the United States of America will select their Commander In Chief. The winner, and his goals and agendas, will play a role in shaping the next stage in Jim Downing's evolution. Meanwhile...Jim's long search for answers about his past comes to an end in this two-part story, featuring the return of fan-favorite villain, Jason Wynn. Wynn, the master puppeteer whose manipulations led to Al Simmons' original fall from grace, now lays bare the full truth regarding Jim's role in 'The Project.' But what are Wynn's true intentions? And what ramifications do they have on global events.

